import Link from "next/link";
import React, { useEffect, useState } from "react";

const Header = () => {
  const [links, setLinks] = useState([
    { name: "Home", url: "/" },
    { name: "Live competitions", url: "/live-competitions" },
    { name: "How to play?", url: "/how-to" },
  ]);

  useEffect(() => {
    console.log(links);
  }, []);

  return (
    <div className='mr-4 text-primary flex p-4 justify-between'>
      <div className='flex'>
        <h1 className='mr-8'>LOGO</h1>
        {links.map((item) => {
          return (
            <div className='text-purple-500  uppercase mr-4'>
              <Link href={item.url} key={item.url}>
                {item.name}
              </Link>
            </div>
          );
        })}
      </div>
      <div>BUttons</div>
    </div>
  );
};

export default Header;
